import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import './Auth.css';

const StudentSignUp = ({ onLogin }) => { 
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    fullName: '', // <--- User types this
    email: '',
    rollNumber: '',
    department: 'Computer Science',
    phoneNumber: '',
    password: '',
    confirmPassword: '',
    agreeToTerms: false
  });

  const departments = [
    'Computer Science', 'Electrical Engineering', 'Mechanical Engineering',
    'Civil Engineering', 'Electronics Engineering', 'Information Technology',
    'Business Administration', 'Mathematics', 'Physics', 'Chemistry'
  ];

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (formData.password !== formData.confirmPassword) {
      alert('Passwords do not match!');
      return;
    }
    if (!formData.agreeToTerms) {
      alert('You must agree to the Terms & Policy');
      return;
    }

    // --- CRITICAL STEP: MAP FULL NAME TO PROFILE NAME ---
    const userData = {
      name: formData.fullName,     // <--- This sets the Profile Name
      email: formData.email,       // <--- This sets the Profile Email
      regNo: formData.rollNumber,  // <--- This sets the Roll Number
      college: "Engineering Tech Institute", 
      department: formData.department // Optional: Add department if your app uses it
    };

    // Send data to App.js and Log In
    onLogin(userData);

    navigate('/'); 
  };

  return (
    <div className="auth-container">
      <div className="auth-card" style={{ maxWidth: '500px' }}>
        <div className="auth-header">
          <h2>Create Account</h2>
          <p>Join EventSphere as a Student</p>
        </div>

        <form onSubmit={handleSubmit} className="auth-form">
          <div className="form-group">
            <label>Full Name</label>
            <input 
              type="text" 
              name="fullName" 
              value={formData.fullName} 
              onChange={handleChange} 
              placeholder="e.g. Rahul Verma" 
              required 
            />
          </div>

          <div className="form-group">
            <label>Email Address</label>
            <input 
              type="email" 
              name="email" 
              value={formData.email} 
              onChange={handleChange} 
              placeholder="your.email@college.edu" 
              required 
            />
          </div>

          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '15px' }}>
            <div className="form-group">
              <label>Roll Number</label>
              <input type="text" name="rollNumber" value={formData.rollNumber} onChange={handleChange} placeholder="CS202301" required />
            </div>
            <div className="form-group">
              <label>Phone Number</label>
              <input type="tel" name="phoneNumber" value={formData.phoneNumber} onChange={handleChange} placeholder="9876543210" required />
            </div>
          </div>

          <div className="form-group">
            <label>Department</label>
            <select name="department" value={formData.department} onChange={handleChange} required>
              {departments.map(dept => <option key={dept} value={dept}>{dept}</option>)}
            </select>
          </div>

          <div className="form-group">
            <label>Password</label>
            <input type="password" name="password" value={formData.password} onChange={handleChange} placeholder="Create password" required minLength="8" />
          </div>

          <div className="form-group">
            <label>Confirm Password</label>
            <input type="password" name="confirmPassword" value={formData.confirmPassword} onChange={handleChange} placeholder="Confirm password" required />
          </div>

          <div className="form-group checkbox-group">
            <label>
              <input type="checkbox" name="agreeToTerms" checked={formData.agreeToTerms} onChange={handleChange} required />
              I agree to the Terms of Service
            </label>
          </div>

          <button type="submit" className="submit-btn">Create Account</button>
        </form>

        <div className="auth-footer">
          <p>
            Already have an account? 
            <Link to="/signin" className="auth-link">Sign In</Link>
          </p>
        </div>
      </div>
    </div>
  );
};

export default StudentSignUp;
